  false,\n\t\"url\": null,\n\t\"notes\": \"The Delmarva Peninsula is a 220-kilometer-long
  headland, spit, and barrier island complex that was significantly affected by Hurricane
  Sandy. A U.S. Geological Survey cruise was conducted in the summer of 2014 to map
  the inner continental shelf of the Delmarva Peninsula using geophysical and sampling
  techniques to define the geologic framework that governs coastal system evolution
  at storm-event and longer timescales. Data collected during the 2014 cruise include
  swath bathymetry, sidescan sonar, chirp and boomer seismic-reflection profiles,
  acoustic Doppler current profiler, and sample and bottom photograph data. Processed
  data in raster and vector format are released here for the bottom photographs and
  sediment samples. More information about the USGS survey conducted as part of the
  Hurricane Sandy Response-- Geologic Framework and Coastal Vulnerability Study can
  be found at the project website or on the WHCMSC Field Activity Web pages: <http://woodshole.er.usgs.gov/project-pages/delmarva/>
